import Toggle from "./toggle/toggle";
import UseWn from "./useWN/useWn";


const Allset = (props) => {
    const theme = useContext(ThemeContext)
  const colorMode = theme.state.colorMode;
    return(
        <div style={{backgroundColor: colorMode? 'white':'', color: colorMode?  'Black':'' }}>
    <Toggle/>
      <Intro />
      <UseWn/>
      <About />
      <ProductList/>
      <Contact/>
     
      {/* <Route path='./about'>
        <About />
      </Route> */}
    </div>
    );

}
